                <button className="popup__button-close" type="button"></button>
                <h2 className='popup__title'>{title}</h2>
                <form 
                    action="submit" 
                    className={`popup__form popup__form_type_${name}`} 
                    name={name}
                    novalidate>
                    {PaymentResponse.children}
                </form>
            </div>
        </div>
    )
}
